import React from 'react'
import './Login.cs'
import { Form, Input, Button, Checkbox } from 'antd';

function Login() {
    return (

        <div className="form">
            <Form
                name="basic"
                labelCol={{
                    span: 8,
                }}
                wrapperCol={{
                    span: 16,
                }}
                initialValues={{
                    remember: false,
                }}
                autoComplete="off"
            >
                <Form.Item
                    label="아이디"
                    name="id"
                    rules={[
                        {
                            required: true,
                            message: '아이디를 입력해주세요!',
                        },
                    ]}
                >
                    <Input />
                </Form.Item>

                <Form.Item
                    label="비밀번호"
                    name="password"
                    rules={[
                        {
                            required: true,
                            message: '비밀번호를 입력해주세요!',
                        },
                    ]}
                >
                    <Input.Password />
                </Form.Item>

                <Form.Item
                    wrapperCol={{
                        offset: 8,
                        span: 16,
                    }}
                >
                    <Button type="primary" htmlType="submit">
                        로그인
                    </Button>
                </Form.Item>
                
                <Form.Item
                    name="remember"
                    valuePropName="checked"
                    wrapperCol={{
                        offset: 8,
                        span: 16,
                    }}
                >
                    <Checkbox>로그인 유지</Checkbox>
                </Form.Item>

            </Form>

        </div>
    )
}

export default Login


